import React from 'react';
import './App.css';
import {Route, Switch} from 'react-router-dom';


const my404 = () => {
  return(
    <div>
      <h3>Error!</h3>
    </div>
  )
}


function App() {
  return (
    <main>
      <Switch>
        <Route exact path='/' render={(props) => <Login {...props} />} />
        <Route component={my404} />
      </Switch>
    </main>
  );
}

export default App;
